      SELECT ALL + + col0 * + - col1 - - - ( col2 ) * - col2 - + 91 AS col0, - ( CAST ( + - col0 AS INTEGER ) ) AS col1 FROM tab1 AS cor0;
  - name: tab1

outputs:
